SELECT F0."s_name" AS "s_name", F0."s_address" AS "s_address", F0."prov_lineitem_l_orderkey1" AS "prov_lineitem_l_orderkey1"
FROM (SELECT * FROM _temp_view_0) F0
ORDER BY F0."s_name" ASC NULLS LAST) F0;


